if (process.env.NODE_ENV === 'development') {
    const devConfig = {
        port: 3000,
        cache: false,
    }
    config = {
        ...config,
        ...devConfig
    }
}

/** 生产环境配置 */
if (process.env.NODE_ENV === 'production') {
    const prodConfig = {
        port: 80,
        cache: 'memeory'
    }
    config = {
        ...config,
        ...prodConfig
    }
}

export default config;

